   );   
   
   signal rom : rom_type := rom_content;
   signal instr_int : std_logic_vector(instr_width-1 downto 0) := (others => '0');
   
begin

   instr_int <= rom(to_integer(unsigned(addr)));
   
   process (clk,rst)
   begin

      if rst = RST_ACT then
         instr <= (others => '0');
      elsif rising_edge(clk) then
         if en = '1' then
            instr <= instr_int;
         end if;
      end if;
   
   end process;

end behavioral;

